export const addArtist = (artist) => {
    console.log(artist, "artists")
    return (dispatch) => {
        fetch("/", {
            method:"POST",
            headers:{"Content-Type":"application/json"},
            body:JSON.stringify({
                artist:artist
            })
        })
        .then(res => res.json())
        .then(response => {
            const action={
                type: 'ADD_ARTIST',
                value: response.artist
            }
            dispatch(action)
        })
    }
}

const fetchCoords = (url) => {
    return (dispatch) => {
    fetch(url)
    .then(res => res.json())
    .then(response => {
    const action = {
    type: 'FETCH_COORDS',
    value: response.results[0].geometry.location
    }
    dispatch(action)
    })
    }
    }
